import './App.css';
import './components/ShiftsListingPage';
import * as React from "react";
import ShiftsListingPage from './components/ShiftsListingPage';

function App() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <Grid container spacing={2} columns={16}>
        <Grid item xs={8}>
          <Item>
            <Button variant="contained" color="blue">
              Set Shift Assignment
            </Button>
          </Item>
        </Grid>
        <Grid item xs={8}>
          <Item>
            <ShiftsListingPage></ShiftsListingPage>
          </Item>
        </Grid>
      </Grid>
    </Box>
  );
}

export default App;
